import React from 'react';
import { motion } from 'framer-motion';

const SubscriptionPlans = () => {
  const pricingPlans = [
    {
      id: 'one-meal',
      title: 'Solo',
      price: 120,
      description: 'One meal daily',
      popular: false,
      mealBoxes: 1,
      accent: '#8B4513' // Brown
    },
    {
      id: 'two-meals',
      title: 'Classic',
      price: 220,
      description: 'Two meals daily',
      popular: true,
      mealBoxes: 2,
      accent: '#DC2626' // Red
    },
    {
      id: 'family-plan',
      title: 'Family',
      price: 440,
      description: 'For two people',
      popular: false,
      mealBoxes: 3,
      accent: '#1F2937' // Dark gray/black
    }
  ];

  const scrollToSection = (sectionId) => {
    const section = document.getElementById(sectionId);
    if (section) {
      window.scrollTo({
        top: section.offsetTop - 80,
        behavior: 'smooth'
      });
    }
  };

  const formatPrice = (amount) => {
    return new Intl.NumberFormat('en-IN', {
      style: 'currency',
      currency: 'INR',
      maximumFractionDigits: 0
    }).format(amount);
  };

  const renderMealBoxes = (count, accentColor) => {
    return (
      <div className="flex justify-center items-center gap-3 mb-8">
        {Array.from({ length: count }, (_, i) => (
          <motion.div
            key={i}
            className="relative"
            initial={{ opacity: 0, scale: 0.8 }}
            whileInView={{ opacity: 1, scale: 1 }}
            viewport={{ once: true }}
            transition={{ duration: 0.4, delay: i * 0.1 }}
            whileHover={{ scale: 1.05, y: -2 }}
          >
            {/* Food container */}
            <div className="w-20 h-16 bg-white rounded-lg shadow-lg border-2 border-gray-200 relative overflow-hidden">
              {/* Container lid */}
              <div className="absolute top-0 left-0 right-0 h-3 bg-gray-100 border-b border-gray-200"></div>

              {/* Food representation */}
              <div className="absolute top-4 left-2 right-2 bottom-2 rounded-md" style={{backgroundColor: accentColor, opacity: 0.1}}>
                {/* Food items */}
                <div className="absolute top-1 left-1 w-3 h-2 rounded-full" style={{backgroundColor: accentColor, opacity: 0.6}}></div>
                <div className="absolute top-1 right-1 w-2 h-2 rounded-full" style={{backgroundColor: accentColor, opacity: 0.4}}></div>
                <div className="absolute bottom-1 left-1 right-1 h-1 rounded-full" style={{backgroundColor: accentColor, opacity: 0.5}}></div>
              </div>

              {/* Brand mark */}
              <div className="absolute bottom-1 right-1 w-2 h-2 rounded-full" style={{backgroundColor: accentColor}}></div>
            </div>
          </motion.div>
        ))}
      </div>
    );
  };

  return (
    <section id="subscription-plans" className="py-0 pb-20 md:pb-28 overflow-hidden section-fade" style={{backgroundColor: '#f9f5f0'}}>
      <div className="container mx-auto px-4 md:px-6">
        <div className="max-w-6xl mx-auto grid grid-cols-1 md:grid-cols-3 gap-6 lg:gap-8">
          {pricingPlans.map((plan, index) => (
            <motion.div
              key={plan.id}
              className={`relative overflow-hidden transition-all duration-300 ${
                plan.popular ? "md:-mt-4 md:mb-4" : ""
              }`}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.6, delay: index * 0.15 }}
              whileHover={{ y: -8, transition: { duration: 0.3 } }}
            >
              {/* Popular badge */}
              {plan.popular && (
                <motion.div 
                  className="absolute -top-3 left-1/2 transform -translate-x-1/2 z-20"
                  initial={{ opacity: 0, y: -10 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  viewport={{ once: true }}
                  transition={{ duration: 0.5, delay: 0.3 }}
                >
                  <div className="bg-gradient-to-r from-orange-400 to-red-500 text-white text-xs font-bold px-4 py-1.5 rounded-full shadow-lg">
                    POPULAR
                  </div>
                </motion.div>
              )}

              {/* Main card */}
              <div className="bg-white rounded-3xl shadow-xl overflow-hidden border border-gray-100">
                {/* Header with gradient background */}
                <div className={`bg-gradient-to-br ${plan.gradient} p-8 text-white relative`}>
                  {/* Decorative elements */}
                  <div className="absolute top-4 right-4 w-20 h-20 bg-white bg-opacity-10 rounded-full"></div>
                  <div className="absolute top-8 right-8 w-12 h-12 bg-white bg-opacity-10 rounded-full"></div>

                  <div className="relative z-10">
                    <h3 className="text-2xl font-bold mb-2">{plan.title}</h3>
                    <p className="text-white text-opacity-90 mb-4">{plan.description}</p>

                    {/* Meal boxes visualization */}
                    {renderMealBoxes(plan.mealBoxes, 'from-white to-gray-100')}

                    {/* Price */}
                    <div className="text-center">
                      <div className="text-4xl font-black mb-1">
                        {formatPrice(plan.price)}
                        <span className="text-lg font-normal opacity-80">/day</span>
                      </div>
                    </div>
                  </div>
                </div>

                {/* Content area */}
                <div className="p-8">
                  {/* Visual features with icons */}
                  <div className="space-y-4 mb-8">
                    <div className="flex items-center justify-center gap-3">
                      <div className="w-8 h-8 bg-green-100 rounded-full flex items-center justify-center">
                        <span className="text-green-600 text-sm">üöö</span>
                      </div>
                      <span className="text-gray-600 font-medium">Free Delivery</span>
                    </div>

                    <div className="flex items-center justify-center gap-3">
                      <div className="w-8 h-8 bg-blue-100 rounded-full flex items-center justify-center">
                        <span className="text-blue-600 text-sm">‚≠ê</span>
                      </div>
                      <span className="text-gray-600 font-medium">Premium Quality</span>
                    </div>

                    <div className="flex items-center justify-center gap-3">
                      <div className="w-8 h-8 bg-purple-100 rounded-full flex items-center justify-center">
                        <span className="text-purple-600 text-sm">üîÑ</span>
                      </div>
                      <span className="text-gray-600 font-medium">Flexible Plans</span>
                    </div>
                  </div>

                  {/* CTA Button */}
                  <motion.button
                    onClick={() => scrollToSection('daily-combos')}
                    className={`w-full py-4 rounded-2xl font-bold text-lg shadow-lg transition-all ${
                      plan.popular 
                        ? "bg-gradient-to-r from-orange-400 to-red-500 hover:from-orange-500 hover:to-red-600 text-white" 
                        : "bg-gradient-to-r from-gray-800 to-gray-900 hover:from-gray-900 hover:to-black text-white"
                    }`}
                    whileHover={{ scale: 1.02 }}
                    whileTap={{ scale: 0.98 }}
                  >
                    Get Started
                  </motion.button>
                </div>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default SubscriptionPlans;
